// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';

const Navbar = () => {
  return (
    <AppBar
      position="static"
      style={{ backgroundColor: 'white', boxShadow: 'none' }} // White background and no shadow
    >
      <Toolbar>
      <Typography 
  variant="h4" 
  style={{
    flexGrow: 1,
    color: '#333',
    fontFamily: "'Playfair Display', 'Lobster', cursive",
    fontSize: '2.5rem',
    fontWeight: '700'
  }}
>
  Nail Tique
</Typography>
        <Button color="inherit" component={Link} to="/" style={{ color: '#333' }}>
          Home
        </Button>
        <Button color="inherit" component={Link} to="/services" style={{ color: '#333' }}>
          Services
        </Button>
        <Button color="inherit" component={Link} to="/contact" style={{ color: '#333' }}>
          Contact Us
        </Button>
        <Button color="inherit" component={Link} to="/location" style={{ color: '#333' }}>
          Location
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
